import React, { Component } from "react";
import { Link } from "react-router-dom";
class Landing extends Component {
	render() {
		return (
			<div
				style={{ height: "75vh" }}
				className="container valign-wrapper"
			>
				<div className="row">
					<div className="col s12 center-align">
						<h4>
							<b>Welcome</b> to the{" "}
							<b style={{ color: "#ff367a" }}>
								Shock Trampoline{" "}
							</b>
							Park Builder{" "}
						</h4>
						<p className="flow-text grey-text text-darken-1">
							<b style={{ color: "#ff367a" }}>Custom</b>{" "}
							Trampoline Parks for{" "}
							<b>Your Family Enternainment Business</b>
						</p>
						<p className="flow-text grey-text text-darken-1">
							Please Register to Continue
						</p>
						<br />
						<div className="col s6">
							<Link
								to="/register"
								className="button btn btn-large waves-effect waves-light hoverable blue accent-3"
							>
								Register
							</Link>
						</div>
						<div className="col s6">
							<Link
								to="/login"
								style={{
									width: "140px",
									borderRadius: "3px",
									letterSpacing: "1.5px"
								}}
								className="btn btn-large btn-flat waves-effect white black-text"
							>
								Log In
							</Link>
						</div>
					</div>
				</div>
			</div>
		);
	}
}
export default Landing;
